import React from 'react';
import Login from '../Login';
import {
  BrowserRouter as Router,
  Route,
} from 'react-router-dom';
import HomePage from '../Home';
import * as ROUTES from '../../constants/routes';




const App = () => {
  return (
    <Route>
      <Login />
      <Route path={ROUTES.HOME} component={HomePage} />
    </Route>
  );
};

export default App;
